  const setData:any = () => {
      let obj = {name: 'Vilde', age: 12, gender: 'female'};
      //let locObj = localStorage.setItem('myLocObj', JSON.stringify(obj)); 
      let sesObj = sessionStorage.setItem('mySesObj',JSON.stringify(obj));
      return sesObj 
  }

  const getData:any = () => {
      let data = localStorage.getItem('mylocObj');
      console.log(data); 
      return data; 
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          <h1> Hello World </h1>
          <button onClick={()=> setData()}> Set Data</button>
          <button onClick={()=> getData()}> Get Data</button>
        </div>
      </header>
    </div>
  );
}

export default App;
